TEST(PaillierTest, KeyTransform) {
    std::string s;
    PailPrivKey priv = safeheron::pail::CreatePailPrivKey(
            priv2048["lambda"],
            priv2048["mu"],
            priv2048["n"],
            priv2048["nSqr"],
            priv2048["p"],
            priv2048["q"],
            priv2048["pSqr"],
            priv2048["qSqr"],
            priv2048["pMinus1"],
            priv2048["qMinus1"],
            priv2048["hp"],
            priv2048["hq"],
            priv2048["qInvP"],
            priv2048["pInvQ"]);

    PailPubKey pub = safeheron::pail::CreatePailPubKey(
            pub2048["n"],
            pub2048["g"]);
    string privJsonStr;
    string pubJsonStr;
    string privBase64;
    string pubBase64;
    PailPrivKey priv2;
    PailPubKey pub2;

    // private key
    priv.ToJsonString(privJsonStr);
    priv2.FromJsonString(privJsonStr);
    priv2.ToJsonString(s);
    EXPECT_TRUE(s == privJsonStr);
    //std::cout << privJsonStr << std::endl;
    //std::cout << s << std::endl;

    priv.ToBase64(privBase64);
    priv2.FromBase64(privBase64);
    priv2.ToBase64(s);
    EXPECT_TRUE(s == privBase64);
    //std::cout << privBase64 << std::endl;
    //std::cout << s << std::endl;

    // public key
    pub.ToJsonString(pubJsonStr);
    pub2.FromJsonString(pubJsonStr);
    pub2.ToJsonString(s);
    EXPECT_TRUE(s == pubJsonStr);
    //std::cout << pubJsonStr << std::endl;
    //std::cout << s << std::endl;

    pub.ToBase64(pubBase64);
    pub2.FromBase64(pubBase64);
    pub2.ToBase64(s);
    EXPECT_TRUE(s == pubBase64);
    //std::cout << pubBase64 << std::endl;
    //std::cout << s << std::endl;
}

